import React from 'react';
import Preview from '../../components/Preview/Preview';

const Shop =({collections}) => (
	<div className='shop'>
		{
			collections.map(({id,...otherCollectionProps})=>(
			<Preview key={id} {...otherCollectionProps}/>
			))
		}
	</div>
);


export default Shop;
